CREATE DEFINER=`root`@`localhost` PROCEDURE `delete_user` (IN `USERID` VARCHAR(10))  BEGIN
    delete from user_mobile where user_mobile_id = USERID;
    delete from user_name where user_name_id = USERID;
    delete from passenger where passenger_id = USERID;
    delete from user_home_location where user_location_id = USERID;
    delete from user_mail where user_id = USERID; 
    
    delete from license where rider_id = USERID;
    delete from rider where rider_id = USERID;
    delete from user where user_id = USERID;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `display_profile` (IN `mail` TEXT)  NO SQL
BEGIN
	DECLARE role varchar(10);
    DECLARE USERID varchar(10);
     
    select user_role into role from user u inner join user_mail um on u.user_id = um.user_id where um.mail = mail;
    
    select um.user_id into USERID from user u inner join user_mail um on u.user_id = um.user_id where um.mail = mail;
    
    IF role='Rider' THEN
		select u.user_id,u.user_year,u.user_dept,u.DP,u.user_role,
        um.user_mobile, un.first_name,un.middle_name,un.last_name,
        ua.location_latitude,ua.location_longitude,ua.user_address 
        from user u inner join user_mobile um inner join user_name un inner join user_home_location ua on u.user_id = um.user_mobile_id and 			u.user_id=um.user_mobile_id and u.user_id=un.user_name_id AND
        ua.user_location_id = u.user_id where u.user_id=USERID;
    ELSE
    	select u.user_id,u.user_year,u.user_dept,u.DP,u.user_role,
        um.user_mobile,
        un.first_name,un.middle_name,un.last_name,
        lc.license_number,lc.license_image,
        rd.bike_number,
        ua.location_latitude,ua.location_longitude,ua.user_address
        from user u inner join user_mobile um inner join user_name un 
        inner join license lc inner join rider rd inner JOIN
        user_home_location ua on 
        u.user_id = um.user_mobile_id and u.user_id=um.user_mobile_id and
        u.user_id=un.user_name_id and u.user_id=lc.rider_id and
        u.user_id=rd.rider_id AND
        ua.user_location_id = u.user_id where u.user_id= USERID;
	END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_rideHistory` (IN `r_id` INT, IN `p_id` INT, IN `s_id` INT, IN `d_id` INT, IN `fare` INT)  BEGIN
	insert into ride_history(rider_id,passenger_id,source_location_id,destination_location_id,ride_timestamp,ride_fare) values(r_id,p_id,s_id,d_id,CURRENT_TIMESTAMP(),fare);
    UPDATE passenger set passenger_status ="Accepted" where passenger_id=p_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_user` (IN `path` LONGTEXT, IN `first_name` TEXT, IN `middle_name` TEXT, IN `last_name` TEXT, IN `USERID` VARCHAR(10), IN `gender` VARCHAR(10), IN `mob` VARCHAR(10), IN `dept` TEXT, IN `year1` TEXT, IN `latitude` TEXT, IN `longitude` TEXT, IN `role` TEXT, IN `bike_num` VARCHAR(10), IN `lic_num` VARCHAR(15), IN `lic_img` LONGTEXT, IN `email` TEXT)  BEGIN
	insert into user(user_id,user_gender,user_year,user_dept,DP,user_role) VALUES (USERID,gender,year1,dept,path,role);
    
    IF role = 'Driver' THEN
     	insert into license values(lic_num,lic_img,USERID);
    	insert into rider(rider_id,bike_number) values (USERID,bike_num);
       
    ELSE
    	insert into passenger(passenger_id) values (USERID);
    END IF;
    
    insert into user_mail(user_id,mail) values (USERID,email);
    
    insert into user_name(user_name_id,first_name,middle_name,last_name) values (USERID,first_name,middle_name,last_name);
    
    insert into user_mobile(user_mobile_id,user_mobile) values (USERID,mob);
    
    insert into user_home_location(user_location_id,location_latitude,location_longitude,user_address) values (USERID,latitude,longitude,NULL);
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `update_passenger` (IN `USERID` INT, IN `fname` VARCHAR(20), IN `mname` VARCHAR(20), IN `lname` VARCHAR(20), IN `locality` INT, IN `year1` INT, IN `dept` INT, IN `mob1` BIGINT, IN `mob2` BIGINT, IN `path` TEXT)  BEGIN
    update user_name set first_name=fname,middle_name=mname,last_name=lname where user_name_id=USERID;
    update user set user_locality_id=locality,user_year_id=year1, user_dept_id=dept,Img_Path=path where user_id=USERID;
     update user_mobile set user_mobile_1=mob1,user_mobile_2=mob2 where user_mobile_id=USERID;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `update_profile` (IN `USERID` VARCHAR(10), IN `data_name` TEXT, IN `data_value1` TEXT, IN `data_value2` TEXT, IN `data_value3` TEXT)  NO SQL
BEGIN
	IF data_name='Year' THEN
    	update user SET user_year=data_value1 where user_id=USERID;
    ELSEIF data_name='DP' THEN
    	update user SET DP=data_value1 where user_id=USERID;
    ELSEIF data_name='Location' THEN
    	update user_home_location SET location_latitude=data_value1, location_longitude=data_value2,user_address=data_value3 where user_location_id=USERID;
	ELSEIF data_name='Mobile' THEN
    	update user_mobile set user_mobile=data_value1 where user_mobile_id=USERID;
    ELSEIF data_name='Name' THEN
    	update user_name SET first_name=data_value1, middle_name=data_value2, last_name=data_value3 where user_name_id=USERID;
   	ELSEIF data_name='BikeNo' THEN 
        update rider SET bike_number=data_value1 where rider_id=USERID;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `update_rider` (IN `USERID` INT, IN `fname` VARCHAR(20), IN `mname` VARCHAR(20), IN `lname` VARCHAR(20), IN `locality` INT, IN `year1` INT, IN `dept` INT, IN `mob1` BIGINT, IN `mob2` BIGINT, IN `bikeno` VARCHAR(20), IN `bname` VARCHAR(20), IN `licenseno` VARCHAR(20), IN `d_path` TEXT)  BEGIN
    UPDATE user_name set first_name=fname,middle_name=mname,last_name=lname where user_name_id=USERID;
    UPDATE user_mobile set user_mobile_1=mob1,user_mobile_2=mob2 where user_mobile_id=USERID;
	UPDATE rider set bike_number=bikeno,bike_name=bname where rider_id=USERID;
    UPDATE license set license_number=licenseno where rider_id=USERID;
    UPDATE user set user_locality_id=locality,user_year_id=year1,user_dept_id=dept,Img_Path=d_path where user_id=USERID;
END$$

